       'body' => '{"total":"7834","products":[{"minPrice":null,"maxPrice":null,"autocomplete":[],"productID":"45","provider":null,"sourceID":null,"url":null,"language":"de_DE","thumbnail":"http:\\/\\/media.douglas.de\\/medias\\/sys_master\\/8451203849019024.image.jpg","pictures":[],"title":"3-Phasen-Systempflege Facial Soap Mild - Nachf\\u00fcllung","shortDesc":"","longDesc":"<h3>Informationen<\\/h3>\\n\\t\\t<p>\\n\\t\\t\\t<span>Nachf\\u00fcll-Packung milder Gesichtsseife f\\u00fcr eher trockene Haut - Facial Soap Mild Refill ist ideal f\\u00fcr die Reinigung trockener bis partienweise trockene Haut. Ihr milder Schaum befreit die Haut sanft, aber gr\\u00fcndlich von Staub und Talg. Die Haut f\\u00fchlt sich sauber an und angenehm erfrischt. Pa\\u00dft als Nachf\\u00fcllung in die sch\\u00f6ne, wiederverwendbare Dose zur perfekten Seifen-Aufbewahrung.<\\/span>\\n\\t\\t<\\/p>\\n\\t\\t\\n            ","vendor":"Clinique","categories":["Clinique","3-Phasen-Systempflege"],"cowids":[],"variants":[{"providerVariants":[{"provider":"douglas","variantID":null,"variant":[],"ean":"","price":"11.95","availability":"100"}],"variantID":"50","variant":{"amount":"100 g"},"ean":"","price":null,"availability":100}],"info":{"Series":"3-Phasen-Systempflege","__units":[]},"rating":null},{"minPrice":null,"maxPrice":null,"autocomplete":[],"productID":"48","provider":null,"sourceID":null,"url":null,"language":"de_DE","thumbnail":"http:\\/\\/media.douglas.de\\/medias\\/sys_master\\/8451212286150560.image.jpg","pictures":[],"title":"3-Phasen-Systempflege Liquid Facial Soap Extra Mild","shortDesc":"","longDesc":"<h3>Informationen<\\/h3>\\n\\t\\t<p>\\n\\t\\t\\t<span>F\\u00fcr die trockene bis sehr trockene Haut. Die ber\\u00fchmte, dermatologisch entwickelte Seife von Clinique jetzt auch in fl\\u00fcssiger Form. Bereitet auf die exfolierende Wirkung der Clarifying Lotion vor. Im praktischen Pumpspender.<\\/span>\\n\\t\\t<\\/p>\\n\\t\\t\\n            <u><li>Eigenschaft:\\n                            erfrischend,\\n                            reinigend,\\n                            feuchtigkeitsspendend\\n                    <\\/li>\\n                    <li>Hauttyp:\\n                            Trockene Haut,\\n                            Sehr trockene Haut\\n                    <\\/li>\\n            <\\/ul>","vendor":"Clinique","categories":["Clinique","3-Phasen-Systempflege"],"cowids":[],"variants":[{"providerVariants":[{"provider":"douglas","variantID":null,"variant":[],"ean":"","price":"19.95","availability":"100"}],"variantID":"53","variant":{"amount":"200 ml"},"ean":"","price":null,"availability":100}],"info":{"Series":"3-Phasen-Systempflege","__units":[]},"rating":null},{"minPrice":null,"maxPrice":null,"autocomplete":[],"productID":"61","provider":null,"sourceID":null,"url":null,"language":"de_DE","thumbnail":"http:\\/\\/media.douglas.de\\/medias\\/sys_master\\/8451908883594656.image.jpg","pictures":[],"title":"A Perfect World Antioxidant moisturizer with White Tea","shortDesc":"","longDesc":"<h3>Informationen<\\/h3>\\n\\t\\t<p>\\n\\t\\t\\t<span>Neue Forschungsergebnisse verschiedener Universit\\u00e4ten zeigen, dass der inzwischen weltbekannte Wei\\u00dfe Tee einer der effektivsten Wirkstoffe ist, um die Haut vor den t\\u00e4glichen Belastungen durch Stress und Umweltbelastungen zu sch\\u00fctzen. Diese Gesichtspflege kombiniert die Kraft des Wei\\u00dfen Tees mit Zuckerrohr-Ferment, der die sch\\u00fctzende Wirkung des wei\\u00dfen Tees zus\\u00e4tzlich unterst\\u00fctzt. F\\u00fcr einen optimalen Feuchtigkeitshaushalt sorgen zudem Hagebutten\\u00f6l und Murumuru-Butter. Das Ergebnis: eine ideale Anti-Stress Creme, die die Haut st\\u00e4rkt und vor den Belastungen des Alltags sch\\u00fctzt.<\\/span>\\n\\t\\t<\\/p>\\n\\t\\t\\n            <u><li>Eigenschaft:\\n                            anti-aging,\\n                            sch\\u00fctzend\\n                    <\\/li>\\n                    <li>Hauttyp:\\n                            Normale Haut\\n                    <\\/li>\\n            <\\/ul>","vendor":"Origins","categories":["Pflege","Gesicht","Tagespflege"],"cowids":[],"variants":[{"providerVariants":[{"provider":"douglas","variantID":null,"variant":[],"ean":"","price":"44.95","availability":"100"}],"variantID":"67","variant":{"amount":"50 ml"},"ean":"","price":null,"availability":100}],"info":{"Series":"A Perfect World","__units":[]},"rating":null},{"minPrice":null,"maxPrice":null,"autocomplete":[],"productID":"63","provider":null,"sourceID":null,"url":null,"language":"de_DE","thumbnail":"http:\\/\\/media.douglas.de\\/medias\\/sys_master\\/8451668287836448.image.jpg","pictures":[],"title":"A Perfect World Creamy Body Cleanser","shortDesc":"","longDesc":"<h3>Informationen<\\/h3>\\n\\t\\t<p>\\n\\t\\t\\t<span>Verw\\u00f6hnen Sie Ihren K\\u00f6rper mit dieser aromatischen, pflegenden Reinigung. Der \\u00fcppige Schaum reinigt sanft, ohne die Haut aus dem Gleichgewicht zu bringen. So k\\u00f6nnen Sie rauen Ellenbogen oder schuppigen, trockenen Stellen Lebewohl sagen. Pflanzliche Glucosamine gleichen Unebenheiten sanft aus und feinstes Aprikosenkern\\u00f6l sowie Karit\\u00e9butter versorgen Ihre Haut mit allem, was sie braucht, um sich wohl zu f\\u00fchlen. Der exklusive Wirkstoff Wei\\u00dfer Tee (Silver Tip) neutralisiert zudem die \'R\\u00e4uber der Jugend\', lange bevor sie Schaden anrichten k\\u00f6nnen.<\\/span>\\n\\t\\t<\\/p>\\n\\t\\t\\n            <u><li>Duftnote:\\n                            aromatisch\\n                    <\\/li>\\n            <\\/ul>","vendor":"Origins","categories":["Pflege","K\\u00f6rper","Reinigung"],"cowids":[],"variants":[{"providerVariants":[{"provider":"douglas","variantID":null,"variant":[],"ean":"","price":"31.95","availability":"100"}],"variantID":"69","variant":{"amount":"200 ml"},"ean":"","price":null,"availability":100}],"info":{"Series":"A Perfect World","__units":[]},"rating":null},{"minPrice":null,"maxPrice":null,"autocomplete":[],"productID":"102","provid