Puppeteer.hostRegistry = function( hostMap ) {
    "use strict";

    this.hostMap = hostMap || {
        "database": "api.storage",
        "search":   "serach"
    };

    this.hostRegexp = new RegExp( "((?:pappetier|puppeteer|glamster).*$)", "i" );
    this.baseHost = window.location.hostname;
};

Puppeteer.hostRegistry.prototype.resolve = function( name ) {
    "use strict";

    if ( !this.hostMap[name] )
