        throw "Unknown host name: " + name;
    }

    return this.hostMap[name] + "." + this.hostRegexp.exec( this.baseHost )[1];
};

Puppeteer.hostRegistry.prototype.setBaseHost = function( host ) {
    "use strict";

    this.baseHost = host;
