       'body' => '/*global jQuery: false, History: false, glamster: false */

(function( global ) {
    "use strict";

    var App, header = "main";

    App = function() {
        var app = this;

        jQuery( \'#content\' ).templating( {
            \'/\':            \'start.tpl\',
            \'/search\':      \'searchFrame.tpl\',
            \'/product\':     \'productFrame.tpl\',
            \'/exit\':        \'exit.tpl\'
        } );

        // General content handling
        jQuery( window ).bind( "contentLoaded", function ( e, target ) {
            jQuery( target ).find( "a" ).not( "[href^=\\"http\\"]" ).bind( "click", function() {
                History.pushState( null, null, jQuery(this).attr( "href" ) );
                return false;
            } );
        } );

        jQuery( window ).enableSearch();
        jQuery( window ).session();

        jQuery( window ).bind( "route", app.initAppBase );

        jQuery( window ).bind( "route:404", app.showNotFound );
        jQuery( window ).bind( "route:main", app.initStartPage );
        jQuery( window ).bind( "route:search", app.initSearchResultPage );
        jQuery( window ).bind( "route:product", app.showProductPage );
        jQuery( window ).bind( "route:exit", app.showExitPage );
    };

    /**
     * Initialize general application configuration
     *
     * @param Event event
     * @param Request request
     */
    App.prototype.initAppBase = function( event, request ) {

        // Reset all singals on "startup"
        jQuery( jQuery.fn.dispatch.sources ).unbind( ".dispatcher" );
        jQuery.fn.dispatch.sources = [];

        $( window ).dispatch( "topseller", "#content", "updatePartial", function ( eventData ) {
            return {
                target:   \'#topseller .topseller\',
                template: \'footer_topseller.tpl\',
                viewData: eventData,
            };
        } );

        $( window ).dispatch( "topvendors", "#content", "updatePartial", function ( eventData ) {
            return {
                target:   \'#topseller .vendors\',
                template: \'footer_vendor.tpl\',
                viewData: {vendors: eventData},
            };
        } );

        $( window ).trigger( "getTopSeller" );
        $( window ).trigger( "getTopVendors" );
    };

    /**
     * Display proper header for current view
     *
     * @param string name
     * @param Callback callback request
     */
    App.prototype.displayHeader = function( name, callback ) {
        var headers = {
            "main":   "header.tpl",
            "search": "searchHeader.tpl"
        };
        // Replace header only for start page
        if ( header !== name ) {
            // Set "main" header
            jQuery( "#content" ).trigger( "updatePartial", [{
                target:   "#header",
                template: headers[name],
                success:  callback
            }] );
        }
        header = name;
    };

    /**
     * Show not found result for unmatched routes
     *
     * @param Event event
     * @param Request request
     */
    App.prototype.showNotFound = function( event, request ) {
        App.prototype.displayHeader( "main" );

        jQuery( \'#content\' ).trigger( \'updateContents\', {
            template: "404.tpl"
        } );
    };

    /**
     * Enable search in given node
     *
     * @param string target
     */
    App.prototype.enableSearch = function( target ) {
        // Search form handling
        jQuery( target ).find( "input[name=phrase]" ).autocomplete( {
            delay: 200,
            minLength: 1,
            source: function ( request, response ) {
                var lastXhr;

                lastXhr = jQuery.getJSON( "http://" + glamster.hostRegistry.resolve( "autocomplete" ) + "/" + request.term, {}, function( data, status, xhr ) {
                    if ( xhr === lastXhr ) {
                        response( data );
                    }
                } );
            }
        } );

        jQuery( target ).find( \'#search\' ).bind( \'submit\', function() {
            History.pushState( null, null, "/s/" + jQuery( "input[name=phrase]" ).val() );
            return false;
        } );
    };

    /**
     * Initialize exit page contents
     *
     * @param Event event
     * @param Request request
     */
    App.prototype.showExitPage = function( event, request ) {
        App.prototype.displayHeader( "main" );

        jQuery( \'#content\' ).trigger( \'updateContents\', {
            template: \'/exit\'
        } );

        jQuery.getJSON(
            "http://" + glamster.hostRegistry.resolve( "url" ) + "/" + request.url.segments[1] + "/" + request.url.segments[2],
            function( data, status, xhr ) {
                jQuery( \'#content\' ).trigger( \'updateContents\', {
                    template: \'/exit\',
                    viewData: {url: data}
                } );
            }
        );

        jQuery( window ).trigger( \'showProduct\', [request.url.segments[2]] );
        jQuery( window ).dispatch( "product", window, "logExit", function ( eventData )
        {
            return {
                product:  eventData.productID,
                vendor:   eventData.vendor,
                provider: request.url.segments[1],
            }
        } );
    };

    /**
     * Initialize start page contents
     *
     * @param Event event
     * @param Request request
     */
    App.prototype.initStartPage = function( event, request ) {
        App.prototype.displayHeader( "main" );

        jQuery( \'#content\' ).trigger( \'updateContents\', {
            template: \'/start\',
            success: function() {
                App.prototype.enableSearch( \'#content\' );
            }
        } );

        $( window ).dispatch( "topseller", "#content", "updatePartial", function ( eventData ) {
            return {
                target:   \'#topsellers\',
                template: \'topsellers.tpl\',
                viewData: eventData,
            };
        } );

        $( window ).trigger( "getTopSeller" );
    };

    /**
     * Initialize search results view
     *
     * Initilize singal handling of search results view.
     *
     * @param Event event
     * @param Request request
     */
    App.prototype.initSearchResultPage = function( event, request ) {
        // Replace header only for start page
        App.prototype.displayHeader(
            "search",
            function () {
                App.prototype.enableSearch( \'#header\' );

                // Trigger instant search, after the user typed something
                jQuery( "form#search" ).dispatch( "autocompletesearch", window, "clearFacets" );
                jQuery( "form#search" ).dispatch( "autocompletesearch", window, "search", function ( eventData )
                {
                    return {
                        phrase: jQuery( "form#search input" ).val(),
                        offset: 0,
                        autocomplete: true
                    };
                }, null, false );

                // Trigger instant search, if the user selected something from the
                // autocomplete plugin
                jQuery( "form#search" ).dispatch( "autocompleteselect", window, "clearFacets" );
                jQuery( "form#search" ).dispatch( "autocompleteselect", window, "search", function( eventData )
                {
                    return {
                        phrase: eventData.item.value,
                        offset: 0,
                        autocomplete: false
                    };
                } );
            }
        );

        // Trigger search, after a facet has been updated
        jQuery( window ).dispatch( "facetsUpdated", window, "search", function ( eventData )
        {
            return {
                phrase: jQuery( "form#search input" ).val(),
                offset: 0,
                autocomplete: true
            };
        }, null, false );

        // Dispatch search results to session logging
        jQuery( window ).dispatch( "searchResults", window, "logSearch", function ( eventData )
        {
            return {
                search: jQuery( "form#search input" ).val()
            }
        } );

        // Dispatch search results to templating
        jQuery( window ).dispatch( "searchResults", "#content", "updatePartial", function ( eventData )
        {
            var page;

            eventData.pager = [];
            for ( page = 0; page * 20 < Math.min( eventData.count, 100 ); page += 1 )
            {
                eventData.pager.push( {
                    page:    page + 1,
                    offset:  page * 20,
                    count:   20,
                    current: ( page * 20 ) === parseInt( eventData.parameters.offset, 10 ),
                    phrase:  eventData.match
                } );
            }

            eventData.start = parseInt( eventData.parameters.offset, 10 ) + 1;
            eventData.end   = parseInt( eventData.parameters.offset, 10 ) + parseInt( eventData.parameters.count, 10 );
            eventData.end   = Math.min( eventData.end, eventData.count );

            return {
                target:   "#result",
                template: "results.tpl",
                viewData: eventData
            };
        } );

        // Dispatch search results to facets
        jQuery( window ).dispatch( "searchResults", "#content", "updatePartial", function ( eventData )
        {
            var facets = {};
            jQuery.each( eventData.facets, function ( type, values ) {
                facets[type] = [];
                jQuery.each( values, function ( name, count ) {
                    facets[type].push( {
                        "name":  name,
                        "count": count,
                        "selected": ( jQuery.inArray( name, eventData.activeFacets[type] ) !== -1 )
                    } );
                } );
            } );

            facets.categories = facets.categories.slice( 0, 10 );
            facets.vendors    = facets.vendors.slice( 0, 10 );
            facets.prices     = {
                min: eventData.activeFacets.prices[0],
                max: eventData.activeFacets.prices[1]
            };

            return {
                target:   "#sidebar",
                template: "facets.tpl",
                viewData: facets,
                success: function() {
                    // @TODO: This might no always work. This actually depends
                    // on the event processing order implemented in browsers.
                    // The event we try to unbind here is binded by another
                    // listener on the template-show-event. We can only "hope"
                    // that the success function is executed afterwards.
                    jQuery( \'#sidebar a\' ).unbind( \'click\' );

                    jQuery.each( ["categories", "vendors", "cowids"], function( key, type ) {
                        jQuery( \'#\' + type + \' li:not(.selected) a\' ).bind( \'click\', function( e ) {
                            jQuery( window ).trigger( "addFacet", [{ type: type, value: jQuery( e.target ).attr( "data" ) }] );
                        } );
                        jQuery( \'#\' + type + \' li.selected a\' ).bind( \'click\', function( e ) {
                            jQuery( window ).trigger( "removeFacet", [{ type: type, value: jQuery( e.target ).attr( "data" ) }] );
                        } );
                    } );

                    jQuery( \'#slider-price-range\' ).slider( {
                        range: true,
                        min:    0,
                        max:    200,
                        values: [facets.prices.min, facets.prices.max],
                        slide: function( event, ui ) {
                            jQuery( \'#price-range input[name="min"]\' ).val( ui.values[0] + "" );
                            jQuery( \'#price-range input[name="max"]\' ).val( ui.values[1] + "" );
                        }
                    } );

                    jQuery( \'#price-range input\' ).bind( \'change\', function() {
                        jQuery( \'#slider-price-range\' ).slider(
                            "option",
                            "values",
                            [parseInt( jQuery( \'#price-range input[name="min"]\' ).val(), 10 ),
                             parseInt( jQuery( \'#price-range input[name="max"]\' ).val(), 10 )].sort()
                        );
                    } );

                    jQuery( \'#slider-price-range\' ).dispatch( \'slidechange\', window, \'addFacet\', function( data, ui ) {
                        return {type: "prices", value: data.values};
                    } );
                }
            };
        } );

        // Dispatch product pricing updates
        jQuery( window ).dispatch( "searchUpdates", "#content", "updatePartial", function ( eventData )
        {
            var availabilities = [ "none", "rare", "good" ],
                bestPrice = null,
                bestPriceData = null,
                worstPrice = null;

            jQuery.each( eventData.prices, function( variant, data )
            {
                jQuery.each( data, function( provider, product )
                {
                    if ( ( bestPrice === null ) ||
                         ( bestPrice > product.price ) ) {
                        bestPriceData = product;
                        bestPrice = product.price;
                    }

                    if ( ( worstPrice === null ) ||
