/*global jQuery: false, glamster: false */

( function( jQuery ) {
    "use strict";

    var frequency = 1000,
        pulling,
        facets = {
        categories: [],
        vendors: [],
        cowids: [],
        prices: [0, 200]
    };

    jQuery.fn.enableSearch = function()
    {
        var performSearch, pullData, showProduct, addFacet, removeFacet, clearFacets, self = this;

        performSearch = function( e, data )
        {
            var phrase = data.phrase,
                parameters = {
                \'offset\':    data.offset,
                \'count\':     20,
                \'apiKey\':    null,
                \'lang\':      \'de\',
                \'currency\':  \'EUR\',
                \'latitude\':  null,
                \'longitude\': null,
                \'referrer\':  null,
                \'filters\':   ["cowid"],
                \'facets\':    facets,
                \'fuzzy\':     data.autocomplete ? true : false
            };

            jQuery( "form#search input" ).val( phrase );

            ( function()
            {
                var requestUrl = "http://" + glamster.hostRegistry.resolve( "search" ) + "/search/" + phrase;
                return jQuery.getJSON( requestUrl, parameters );
            }() ).then( function( data, status, xhr )
            {
                clearTimeout( self.pulling );
                window.setTimeout(
                    function ()
                    {
                        pullData( data.handle, parameters.offset );
                    },
                    frequency
                );
                data.parameters    = parameters;
                data.phrase        = phrase;
                data.activeFacets  = facets;
                data.facets.cowids = {
                    \'maskulin\':   1,
                    \'feminin\':    1,
                    \'sinnlich\':   1,
                    \'spritzig\':   1,
                    \'fruchtig\':   1,
                    \'klassisch\':  1,
                    \'Moschus\':    1,
                    \'Sandelholz\': 1,
                    \'Patschuli\':  1
                };
                jQuery( "body,html" ).animate( {
                    scrollTop: 0
                }, 500 );
                jQuery(self).trigger( "searchResults", [data] );

                console.log( "Response time: " + data.time.toFixed( 3 ) + " seconds" );
            } );

            return false;
        };

        pullData = function( handle, offset )
        {
            ( function()
            {
                return jQuery.getJSON( "http://" + glamster.hostRegistry.resolve( "search" ) + "/pull/" + handle, {offset: offset} );
            }() ).then( function( data, status, xhr )
            {

                // Recurse, if data was not complete, yet:
                var finished = true;
                jQuery.each( data, function( key, value )
                {
                    if ( value === false )
                    {
                        finished = false;
                        return;
                    }

                    jQuery(window).trigger( "searchUpdates", {
                        product: key,
                        prices:  value
                    } );
                } );

                if ( !finished )
                {
                    clearTimeout( self.pulling );
                    window.setTimeout(
                        function ()
                        {
                            pullData( handle, offset );
                        },
                        frequency
                    );
                }
            } );
        };

        showProduct = function( e, product )
        {
            ( function()
            {
                var requestUrl = "http://" + glamster.hostRegistry.resolve( "db" ) + "/product/" + product;
                return jQuery.getJSON( requestUrl );
            }() ).then( function( data, status, xhr )
            {
                jQuery(self).trigger( "product", data );
            } );

            return false;
        };

        addFacet = function( e, facet )
        {
            if ( facet.type === "prices" ) {
                facets[facet.type] = facet.value;
            } else {
                facets[facet.type].push( facet.value );
            }
            jQuery(self).trigger( "facetsUpdated" );

            return false;
        };

        removeFacet = function( e, facet )
        {
            if ( facet.type === "prices" ) {
                facets[facet.type] = [0, 200];
            } else {
                var index = facets[facet.type].indexOf( facet.value );
                if ( index !== -1 ) {
                    facets[facet.type].splice( index, 1 );
                }
            }
            jQuery(self).trigger( "facetsUpdated" );

            return false;
        };

        clearFacets = function( e, facet )
        {
            facets = {
                categories: [],
                vendors: [],
                cowids: [],
                prices: [0, 200]
            };

            return false;
        };

        return this.each( function()
        {
            jQuery(this).bind( "search", performSearch );
            jQuery(this).bind( "showProduct", showProduct );
            jQuery(this).bind( "addFacet", addFacet );
            jQuery(this).bind( "clearFacets", clearFacets );
            jQuery(this).bind( "removeFacet", removeFacet );
        } );
    };
}( jQuery ) );
